import React from "react";
import CrecheSlider from "./CrecheSlider";



const GstCreches = () => { 
    return (   
       
        <div className="max-w-[800px] mt-[5] w-full h-screen mx-auto text-center flex flex-col justify-center text-[#0B0C38]">
             
              <h1 className=" md:text-7xl sm:text-6xl text-4xl font-bold md:py-6 font-concert ">
              Gestion des Creches
              </h1>
             
                <CrecheSlider/>

                <div className="flex justify-center items-center ">
                    <p className=" md:text-5xl sm:text-4xl text-xl font-bold pl-2">
                         Fast,flexible financing for BTB.
                    </p>
                </div>
              
            <button className="bg-[#FB9B90] w-[160px] rounded-md font-bold my-6 mx-auto py-3 text-[#191A43] border-5  border-[#ED6361] hover:scale-110 duration-300"> Ajouter </button>
              
             
        </div>
    
    )
}

export default GstCreches;
